import { BookList } from 'components'
import styles from './selectBook.module.scss'

const SelectBook = () => {
  return (
    <div className={styles.selectBook}>
      평가한 작품들로 카드를 만들 수 있어요!
      <button type='button'>책 검색하기</button>
      <button type='button'>읽고 있던 책 평가하기</button>
      <BookList search='' title='' next={false} isLink storeName='ratingStore' />
    </div>
  )
}

export default SelectBook
